import React from 'react';
import './App.css';

function Header() {
    return (
        <nav>
            <h3>Kopi Mahal PABW</h3>
            <ul className='nav-link'>
                <li>CSV</li>
                <li>XML</li>
                <li>Json</li>
            </ul>
        </nav>
    );
}

export default Header;
